import CardTotalCategorias from './components/dashboard/CardTotalCategorias';


function App() {
  return (
    <div className='body'>
      <div>
        <Sidebar />
      </div>
      <AdminCard />

      <div className='main-content'>
      <CardTotalProductos />
      <CardTotalUsuarios />
      <CardTotalCategorias />
      <CardUltimoUsuario />
      <CandidatesList />
      </div>

    </div>
  );
}




export default App;
